import logo from "./logo.svg";
import "./App.css";
import Datas from "./data.json";

function App() {
  const list = Datas.map((data) => <li>{data.color}</li>);
  return (
    <div className="App">
      <h1>APP</h1>
      <ul>
        {Datas.map((data, index) => (
          <li key={index}>{data}</li>
        ))}
      </ul>
    </div>
  );
}

export default App;
